#include<string>
using namespace std;

vector<int> parse_nested_parens(string paren_string){
    vector<int> result;
    string group = "";
    for (char c : paren_string) {
        if (c == ' ') {
            if (!group.empty()) {
                int max_depth = 0;
                int current_depth = 0;
                for (char ch : group) {
                    if (ch == '(') {
                        current_depth++;
                        max_depth = max(max_depth, current_depth);
                    } else if (ch == ')') {
                        current_depth--;
                    }
                }
                result.push_back(max_depth);
                group = "";
            }
        } else {
            group += c;
        }
    }
    if (!group.empty()) {
        int max_depth = 0;
        int current_depth = 0;
        for (char ch : group) {
            if (ch == '(') {
                current_depth++;
                max_depth = max(max_depth, current_depth);
            } else if (ch == ')') {
                current_depth--;
            }
        }
        result.push_back(max_depth);
    }
    return result;
}

