using namespace std;

double poly(vector<double> xs, double x){
    double sum=0;
    int i;
    for (i=0;i<xs.size();i++)
    {
        sum+=xs[i]*pow(x,i);
    }
    return sum;
}

double find_zero(vector<double> xs){
    double low = -1000.0;
    double high = 1000.0;
    double eps = 0.00001;
    while (high - low > eps) {
        double mid = (low + high) / 2.0;
        if (poly(xs, mid) * poly(xs, low) < 0) {
            high = mid;
        } else {
            low = mid;
        }
    }
    return (low + high) / 2.0;
}

