int modp(int n, int p) {
    if (n == 0) return 1;
    if (n % 2 == 0) {
        long long temp = modp(n / 2, p);
        return (temp * temp) % p;
    } else {
        return (2 * modp(n - 1, p)) % p;
    }
}

