bool will_it_fly(vector<int> q, int w) {
    int sum = 0;
    for (int num : q) {
        sum += num;
    }
    if (sum > w) {
        return false;
    }
    int left = 0, right = q.size() - 1;
    while (left < right) {
        if (q[left] != q[right]) {
            return false;
        }
        left++;
        right--;
    }
    return true;
}

