    if (n == 2) return true;
    if (n % 2 == 0) return false;
    for (int i = 3; i * i <= n; i += 2) {
        if (n % i == 0) return false;
    }
    return true;
}

// Function to check if a number is the product of 3 prime numbers
bool is_multiply_prime(int a) {
    for (int i = 2; i < 100; i++) {
        if (is_prime(i) && a % i == 0) {
            int b = a / i;
            for (int j = 2; j < 100; j++) {
                if (is_prime(j) && b % j == 0) {
                    int c = b / j;
                    if (is_prime(c)) return true;
                }
            }
        }
    }
    return false;
}

