bool isPalindrome(int num) {
    string str = to_string(num);
    int start = 0, end = str.length() - 1;
    while (start < end) {
        if (str[start] != str[end]) return false;
        start++;
        end--;
    }
    return true;
}

vector<int> even_odd_palindrome(int n) {
    int evenCount = 0, oddCount = 0;
    for (int i = 1; i <= n; i++) {
        if (isPalindrome(i)) {
            if (i % 2 == 0) evenCount++;
            else oddCount++;
        }
    }
    return {evenCount, oddCount};
}

