map<char,int> histogram(string test){
    map<char,int> countMap;
    int maxCount = 0;
    map<char,int> result;

    // Split the string into words and count the occurrence of each letter
    stringstream ss(test);
    string word;
    while (ss >> word) {
        for (char c : word) {
            if (countMap.find(c) != countMap.end()) {
                countMap[c]++;
            } else {
                countMap[c] = 1;
            }
            maxCount = max(maxCount, countMap[c]);
        }
    }

    // Create the result map with letters that have the maximum count
    for (auto& pair : countMap) {
        if (pair.second == maxCount) {
            result[pair.first] = pair.second;
        }
    }

    return result;
}

