int countOnes(int n) {
    int count = 0;
    while (n) {
        count += n & 1;
        n >>= 1;
    }
    return count;
}

// Custom comparator function for sorting
bool compare(int a, int b) {
    int onesA = countOnes(abs(a));
    int onesB = countOnes(abs(b));
    if (onesA == onesB) {
        return a < b;
    }
    return onesA < onesB;
}

