vector<string> select_words(string s, int n) {
    vector<string> words;
    string word = "";
    for (char c : s) {
        if (c == ' ') {
            words.push_back(word);
            word = "";
        } else {
            word += c;
        }
    }
    if (!word.empty()) {
        words.push_back(word);
    }

    vector<string> result;
    string consonants = "bcdfghjklmnpqrstvwxyzBCDFGHJKLMNPQRSTVWXYZ";
    for (string w : words) {
        int count = 0;
        for (char c : w) {
            if (consonants.find(c) != string::npos) {
                count++;
            }
        }
        if (count == n) {
            result.push_back(w);
        }
    }
    return result;
}

