using namespace std;
string match_parens(vector<string> lst){
    int count1 = 0, count2 = 0;
    for (char c : lst[0]) {
        if (c == '(') count1++;
        else count1--;
    }
    for (char c : lst[1]) {
        if (c == '(') count2++;
        else count2--;
    }
    return (abs(count1 + count2) <= 1) ? "Yes" : "No";
}

#undef NDEBUG
#include<assert.h>
int main(){
    assert (match_parens({"()(", ")"}) == "Yes");
    assert (match_parens({")", ")"}) == "No");
    assert (match_parens({"(()(())", "())())"}) == "No");
    assert (match_parens({")())", "(()()("}) == "Yes");
    assert (match_parens({"(())))", "(()())(("}) == "Yes");
    assert (match_parens({"()", "())"}) == "No");
    assert (match_parens({"(()(", "()))()"}) == "Yes");
    assert (match_parens({"((((", "((())"}) == "No");
    assert (match_parens({")(()", "(()("}) == "No");
    assert (match_parens({")(", ")("}) == "No");
    assert (match_parens({"(", ")"}) == "Yes");
    assert (match_parens({")", "("}) == "Yes" );
}

