vector<string> split_words(string txt){
    vector<string> out;
    if (txt.find(' ') != string::npos) {
        size_t pos = 0;
        while ((pos = txt.find(' ')) != string::npos) {
            out.push_back(txt.substr(0, pos));
            txt.erase(0, pos + 1);
        }
        out.push_back(txt);
    } else if (txt.find(',') != string::npos) {
        size_t pos = 0;
        while ((pos = txt.find(',')) != string::npos) {
            out.push_back(txt.substr(0, pos));
            txt.erase(0, pos + 1);
        }
        out.push_back(txt);
    } else {
        int count = 0;
        for (char c : txt) {
            if (c >= 'a' && c <= 'z' && (c - 'a') % 2 != 0) {
                count++;
            }
        }
        out.push_back(to_string(count));
    }
    return out;
}

