vector<int> tri(int n){
    vector<int> trib(n + 1);
    trib[0] = 1;
    if (n >= 1) trib[1] = 3;
    if (n >= 2) trib[2] = 2;
    for (int i = 3; i <= n; i++) {
        if (i % 2 == 0) trib[i] = 1 + i / 2;
        else trib[i] = trib[i - 1] + trib[i - 2] + trib[i - 3];
    }
    return trib;
}

