// Function to check if a cell is valid
bool isValid(int x, int y, int n) {
    return (x >= 0 && x < n && y >= 0 && y < n);
}

// Function to perform DFS
void dfs(int x, int y, int k, vector<vector<int>>& grid, vector<int>& path, vector<vector<bool>>& visited, vector<int>& result) {
    int n = grid.size();
    if (k == 0) {
        if (path.size() < result.size() || result.empty()) {
            result = path;
        }
        return;
    }
    visited[x][y] = true;
    path.push_back(grid[x][y]);
    int dx[] = {-1, 1, 0, 0};
    int dy[] = {0, 0, -1, 1};
    for (int i = 0; i < 4; i++) {
        int nx = x + dx[i];
        int ny = y + dy[i];
        if (isValid(nx, ny, n) && !visited[nx][ny]) {
            dfs(nx, ny, k - 1, grid, path, visited, result);
        }
    }
    path.pop_back();
    visited[x][y] = false;
}

vector<int> minPath(vector<vector<int>> grid, int k) {
    int n = grid.size();
    vector<int> result;
    vector<vector<bool>> visited(n, vector<bool>(n, false));
    for (int i = 0; i < n; i++) {
        for (int j = 0; j < n; j++) {
            vector<int> path;
            dfs(i, j, k, grid, path, visited, result);
        }
    }
    return result;
}

