// Function to convert string to float, handling both '.' and ',' as decimal separators
float stringToFloat(const string& str) {
    string temp = str;
    replace(temp.begin(), temp.end(), ',', '.');
    return stof(temp);
}

boost::any compare_one(boost::any a, boost::any b) {
    // Convert both inputs to float, handling strings and different decimal separators
    float fa, fb;
    if (a.type() == typeid(string)) fa = stringToFloat(any_cast<string>(a));
    else if (a.type() == typeid(int)) fa = any_cast<int>(a);
    else fa = any_cast<float>(a);

    if (b.type() == typeid(string)) fb = stringToFloat(any_cast<string>(b));
    else if (b.type() == typeid(int)) fb = any_cast<int>(b);
    else fb = any_cast<float>(b);

    // Compare the values
    if (fa > fb) return a;
    else if (fa < fb) return b;
    else return boost::any("None"); // Return "None" if the values are equal
}

#undef NDEBUG
#include<assert.h>
int main(){
    assert (boost::any_cast<int>(compare_one(1, 2)) == 2);
    assert (boost::any_cast<double>(compare_one(1, 2.5))== 2.5);
    assert (boost::any_cast<int>(compare_one(2, 3)) == 3);
    assert (boost::any_cast<int>(compare_one(5, 6)) == 6);
    assert (boost::any_cast<string>(compare_one(1, string("2,3")))== "2,3");
