string fix_spaces(string text){
    string result = "";
    int consecutive_spaces = 0;
    for (char c : text) {
        if (c == ' ') {
            consecutive_spaces++;
            if (consecutive_spaces == 1) {
                result += '_';
            } else if (consecutive_spaces > 2) {
                result = result.substr(0, result.size() - 1) + '-';
