// Function to calculate the sum of digits of a number
int sumOfDigits(int n) {
    int sum = 0;
    while (n != 0) {
        sum += abs(n % 10);
        n /= 10;
    }
    return sum;
}

vector<int> order_by_points(vector<int> nums){
    // Create a vector of pairs to store the sum of digits and the original index
    vector<pair<int, int>> sumAndIndex;
    for (int i = 0; i < nums.size(); i++) {
        sumAndIndex.push_back({sumOfDigits(nums[i]), i});
    }

    // Sort the vector of pairs based on the sum of digits and the original index
    sort(sumAndIndex.begin(), sumAndIndex.end(), [](const pair<int, int>& a, const pair<int, int>& b) {
        if (a.first == b.first) {
            return a.second < b.second;
        }
        return a.first < b.first;
    });

    // Create the result vector by mapping the sorted pairs back to the original numbers
    vector<int> result;
    for (const auto& pair : sumAndIndex) {
        result.push_back(nums[pair.second]);
    }

    return result;
}

