string Strongest_Extension(string class_name, vector<string> extensions) {
    string strongestExtension = extensions[0];
    int maxStrength = 0;

    for (char c : strongestExtension) {
        if (isupper(c)) maxStrength++;
        if (islower(c)) maxStrength--;
    }

    for (int i = 1; i < extensions.size(); i++) {
        int strength = 0;
        for (char c : extensions[i]) {
            if (isupper(c)) strength++;
            if (islower(c)) strength--;
        }
        if (strength > maxStrength) {
            maxStrength = strength;
            strongestExtension = extensions[i];
        }
    }

    return class_name + "." + strongestExtension;
}

