vector<int> make_a_pile(int n){
    vector<int> pile;
    for (int i = 0; i < n; i++) {
        if (n % 2 == 0) {
            pile.push_back(n + 2 * i);
        } else {
            pile.push_back(n + 2 * i);
        }
        n = (n % 2 == 0) ? n + 1 : n + 2;
    }
    return pile;
}

